    /**
     * Display a home page.
     *
     */
    public function home()
    {
        $comments = Comment::get();
        $informations = Information::get();
        $firstPost = Post::where('post_category_id', '1')
            ->orderby('created_at', 'desc')
            ->first();
        $secondPost = Post::where('post_category_id', '2')
            ->orderby('created_at', 'desc')
            ->first();
        $hotel = Hotel::where('sale', true)
            ->where('published', true)
            ->orderby('priority', 'desc')
            ->first();

        $room = '';
        if ($hotel) {
            $room = $hotel->rooms()->orderby('price', 'asc')
                ->first();
        }
        
        return view('index', [
            'comments' => $comments,
            'informations' => $informations,
            'firstPost' => $firstPost,
            'secondPost' => $secondPost,
            'hotel' => $hotel,
            'room' => $room,
        ]);
    }

    /**
     * Show a single blog post.
     *
     */
    public function showPost($id, Request $request)
    {
        $post = Post::findOrFail($id);
        $post->views = $post->views + 1;
        $post->save();
        $categories = PostCategory::get();
        $mostPosts = Post::orderby('views', 'desc')
            ->limit(5)
            ->get();
        $comments = $post->comments()
            ->orderby('created_at', 'desc')
            ->get();
        $s_roNum = $request->session()->get('roomnumber');
        $p_Num = $request->session()->get('peoplenumber');
        $startDate = $request->session()->get('startDate');
        $endDate = $request->session()->get('endDate');
        $place = $request->session()->get('place');
        return view('post', [
            'post' => $post,
            'categories' => $categories,
            'mostPosts' => $mostPosts,
            'roomnumber' => $s_roNum,
            'peoplenumber' => $p_Num,
            'startdate' => $startDate,
            'enddate' => $endDate,
            'place' => $place,
            'comments' => $comments,
        ]);
    }

    /**
     * Show all blog posts.
     *
     */
    public function showPosts(Request $request)
    {
        $posts = Post::orderby('created_at', 'desc')
            ->paginate(10);
        $categories = PostCategory::get();
        $s_roNum = $request->session()->get('roomnumber');
        $p_Num = $request->session()->get('peoplenumber');
        $startDate = $request->session()->get('startDate');
        $endDate = $request->session()->get('endDate');
        $place = $request->session()->get('place');
        $mostPosts = Post::orderby('views', 'desc')
            ->limit(5)
            ->get();

        return view('posts', [
            'posts' => $posts,
            'categories' => $categories,
            'mostPosts' => $mostPosts,
            'roomnumber' => $s_roNum,
            'peoplenumber' => $p_Num,
            'startdate' => $startDate,
            'enddate' => $endDate,
            'place' => $place,
        ]);
    }

