    /**
     * Store 'Husel ilgeeh' form of 'Holboo barih' page.
     *
     */
    public function storeFeedback(Request $request)
    {
        $this->validate($request, [
            'email' => 'required',
            'name' => 'required',
            'content' => 'required',
            'g-recaptcha-response' => 'required|recaptcha',
        ]);

        $feedback = new Feedback;
        $feedback->email = $request->get('email');
        $feedback->name = $request->get('name');
        $feedback->content = $request->get('content');
        $feedback->save();

        return response()->json([
            'success' => true,
        ], 200);
    }

    public function aspac(Request $request)
    {
        \Session::put('locale', 'en');
        \App::setLocale('en');
        $startDate = Carbon::parse('2017-06-08')->format('m/d/Y');
        $endDate = Carbon::parse('2017-06-12')->format('m/d/Y');
		$s_roNum = 1;
        $p_Num = 1;
		$place = $request->session()->get('place');
        $hotels = Hotel::with('rooms')->get();
        $hotel_id = $request->session()->get('hotel_id');
        $rate = Option::find(7)->value;
        $rooms = Room::max('price');
        if ($rooms == null) {
            $rooms = 100000;
        }
        $count =  collect($hotels)->count();
        return view('search', [
            'roomnumber' => $s_roNum,
            'peoplenumber' => $p_Num,
            'startdate' => $startDate,
            'enddate' => $endDate,
            'place' => $place,
            'count' => $count/10,
            'hotel_id' => $hotel_id,
            'maxprice' => $rooms,
            'hotels' => $hotels,
            'rate' => $rate,
            ]);
    }

    public function is_url_exist($url){
        $ch = curl_init($url);    
        curl_setopt($ch, CURLOPT_NOBODY, true);
        curl_exec($ch);
        $code = curl_getinfo($ch, CURLINFO_HTTP_CODE);
        
        if($code == 200){
            $status = true;
        }
        else {
            $status = false;
        }
        curl_close($ch);
        return $status;
    }

