                $room = \App\Room::where('key', $order['room']['objectId'])
                    ->first();
                $user = \App\User::where('key', $order['user']['objectId'])
                    ->first();
                $hotel = \App\Hotel::where('key', $order['hotel']['objectId'])
                    ->first();
                if ($user AND $hotel AND $room) {
                    $model = new \App\Order;
                    $model->user_id = $user->id;
                    $model->hotel_id = $hotel->id;
                    $model->hotel_name = $hotel->name;
                    $model->day = $order['days'];
                    $model->startdate = $order['start'];
                    $model->enddate = $order['end'];
                    $model->day = $order['days'];
                    $model->price_dollar = $order['total'];
                    $model->created_at = date('Y-m-d h:i:s', strtotime($order['createdAt']));
                    $array = [];
                    if ($order['pickup'] == "budget") {
                        $pickup = \App\Pickup::where('id', 2)
                            ->first();

                        $array = [
                            'id' => $pickup->id,
                            'name' => $pickup->name,
                            'name_en' => $pickup->name_en,
                        ];
                    }
                    else if ($order['pickup'] == "vip") {
                        $pickup = \App\Pickup::where('id', 1)
                            ->first();

                        $array = [
                            'id' => $pickup->id,
                            'name' => $pickup->name,
                            'name_en' =>  $pickup->name_en,
                        ];
                    }
                    $model->pickup = serialize($array);
                    $array = [];
                    $array[] = [
                        'room_id' => $room->id,
                        'room_name' => $room->name,
                        'room_number' => $order['qty'],
                        'room_price' => $room->price,
                    ];
                    $model->rooms = serialize($array);
                    $model->carddata = json_encode((object) [
                        'cardnumber' => '',
                        'cardname' => '',
                        'expirymonth' => '',
                        'expiryyear' => '',
                        'cvv' => '',
                    ]);
                    if($order['status'] == 1){
                        $model->status = 2;
                    }else if ($order['status'] == -1){
                        $model->status = 3;
                    }else if ($order['status'] == 0){
                        $model->status = 1;
                    }
                    $model->save();

                    $model->number = 'PO-'.$model->id;
                    $model->save();
                }
                else {
                    $wtf[] = $order;
                }
            }
            else {
                $wtf[] = $order;
            }
        }

        dd($wtf);
    }
}
